import React from 'react';
import Chart from 'react-apexcharts';
// import './graph.css';







function RadialChart () {
  let series = [71, 63, 77];

  var optionsCircle4 = {
    chart: {
      type: 'radialBar',
      height: 400,
      width: 380,
    },
    plotOptions: {
      radialBar: {
        size: undefined,
        inverseOrder: true,
        hollow: {
          // margin: 0,
          size: '48%',
          background: 'transparent',

        },
        track: {
          show: false,
        },
        startAngle: -180,
        endAngle: 180

      },
    },
    stroke: {
      lineCap: 'round'
    },
    labels: ['June', 'May', 'April'],
    legend: {
      show: true,
      floating: true,
      position: 'right',
      offsetX: 70,
      offsetY: 240
    },
  }

  return (


      <div class="radial-charttt col-md-7">
        <div class="box shadow mt-4">
          <Chart options={optionsCircle4} series={series} type="radialBar" height={380} />
        </div>
      </div>


  );
}

export default RadialChart;
